class DisciplinaryHistoryRequest  {  DisciplinaryHistoryRequest({    this.file,    this.level,    this.remarks,    this.misconducts,    this.action,    this.date,    this.filename,    this.username,  });  String? file;  String? level;  String? remarks;  List<String>? misconducts;  List<String>? action;  String? date;  String? filename;  String? username;  factory DisciplinaryHistoryRequest.fromJson(Map<String, dynamic> json) => DisciplinaryHistoryRequest(    file: json["file"],    level: json["level"],    remarks: json["remarks"],    misconducts: List<String>.from(json["misconducts"].map((x) => x)),    action: List<String>.from(json["action"].map((x) => x)),     date :json["date"],      filename: json["filename"],      username: json["username"]  );  Map<String, dynamic> toJson() => {    "file": file,    "level": level,    "remarks": remarks,    "misconducts": List<dynamic>.from(misconducts!.map((x) => x)),    "action": List<dynamic>.from(action!.map((x) => x)),    "date": date,    "filename": filename,    "username": username  };}